@-moz-document url-prefix(http://www.tumblr.com/),url-prefix(https://www.tumblr.com/){

#popover_blogs .tab_notice:after{display:none; }
div.l-header .iconic>a{
		background-image:url('http://media.tumblr.com/0a921748e15ed0577814ca6330f0b39e/tumblr_inline_narflgKOBX1qkv2pp.png') !important;}
    
    .tab_bar .iconic a.tab_anchor {
  background-size: 170px 36px;
}
  
  .tab.iconic > .tab_anchor::before { 
	content: none !important;
}


 #activity_button a, #messaging_button.with_notice, #inbox_button a, #account_button, #discover_button a, #home_button a {

    height: 0 !important;
    width: 0 !important;
    top: 0px !important;
    padding-left: 36px !important;
    padding-top: 36px !important;

 }
/* i really want this to be global */
}
#messaging_button {
  background-image: url("http://41.media.tumblr.com/c3297dd0530e1270b1f1b9e03bc13410/tumblr_inline_nxmo3mkkHi1qkv2pp_75sq.png") !important;
  background-size: 36px 36px !important;
  background-repeat: no-repeat !important;
    opacity: .7 !important;}

#account_button {
    background-image: url("http://media.tumblr.com/58143146018be44d544cf76b67743047/tumblr_inline_nktu9egVpj1qkv2pp.png") !important;
    background-repeat: no-repeat !important;
    background-size: 37px 37px !important;
   opacity: .7 !important;}
#activity_button a {
    height: 0 !important;
    width: 0 !important;
    top: 0px !important;
    padding-left: 37px !important;
    padding-top: 37px !important;
    background: url('http://41.media.tumblr.com/c9cdcd0fb02e58367d0ee23a7c40b2a0/tumblr_inline_nmigvi6auk1qkv2pp_75sq.png') !important;} 
.tab_bar .tab_nav_account tab_anchor {background-position: -175 0}
.tab_bar .tab_activity .tab_anchor {background-position: -140 0}
.tab_bar .tab_messaging.with_notice .tab_anchor {background-position: -105 0}  
.tab_bar .tab_inbox .tab_anchor {background-position: -70px 0}
.tab_bar .tab_discover .tab_anchor {background-position: -35px 0}
.tab_bar .tab_home .tab_anchor {background-position: 0 0}
.tab_bar .tab.iconic:hover .tab_anchor,.tab_bar .tab.iconic:active .tab_anchor {
  opacity: .7;
}
.tab_bar .tab.iconic:hover .tab_anchor,.tab_bar .tab.iconic:active .tab_anchor {opacity: .7;}



.tab.iconic > .tab_anchor::before {content: none !important;}



.tab.iconic > .tab_anchor i::before {content: none !important;}
